import "./Sidebar.css";
const Sidebar = ({ show, click }) => {
  const SidebarClass = ["sidebar"];

  if (show) {
    SidebarClass.push("show");
  }
  return (
    <div className={SidebarClass.join(" ")} onClick={click}>
      Sidebar
    </div>
  );
};

export default Sidebar;
